import styled from 'styled-components';

export const TabName = styled.h1`
    background-color: #C4EBD8;
    padding: 15px;
    font-size: 20px;
    font-style: bold;
    position: absolute;
    left: 10%;
    transform: translate(-50%, -50%);
`
